import React, { useEffect, useState } from 'react'; 
import axios from 'axios';
function Fetchtable(){
    const [rec,setRec]=useState([]);
    useEffect(()=>{
        axios.get('http://localhost:5050/api/call/userinfo/')
        .then(res=>set(res.data))
        .catch(err=>console.log(err));

    },[])
    return(
<table>
    <thead>
        <tr>
            <th>Email</th>
            <th>FirstName</th>
            <th>LastName</th>
            <th>Mobile</th>
            <th>DOB</th>
            <th>Action</th>
        </tr>
    </thead>
    <tbody>
        {
           rec.map((user, index) => (
            <tr key={index}>
              <td>{user.email}</td>
              <td>{user.firstname}</td>
              <td>{user.lastname}</td>
              <td>{user.mobile}</td>
              <td>{user.dob}</td>
              <td>
                <button>Edit</button>
                <button>Delete</button>
              </td>
            </tr>
          ))

        }
    </tbody>
</table>
    )
}
export default Fetchtable;
